import {Map, InfoWindow, Marker, MarkerWithLabel, GoogleApiWrapper, } from 'google-maps-react';


export class Markerr extends Component {

  render(){
    return <Marker ref={(marker)=>this._marker = marker}
    onClick={this.onMarkerClick}
    name={'Current location'} 
    draggable={true}
    onMouseover={()=>this.markerHover()}
    initialCenter={this.state.coords}
    position={this.state.coords}
    onDragend={(t, map, coord) => this.onMarkerDragEnd(coord)}/>
  }

}

export default Marker
